// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

/**
 * @title Minimal ERC20 implementation (no OpenZeppelin)
 * @notice Provides ERC20 basic functionality: transfer, approve, transferFrom,
 *         allowance, and events, with an initial supply minted to deployer.
 */
contract MyERC20 {
    // ERC20 metadata
    string private _name;
    string private _symbol;
    uint8 private _decimals;

    // ERC20 storage
    uint256 private _totalSupply;
    // Max total supply (in smallest units)
    uint256 private _cap;
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    // Events per ERC20 standard
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    constructor(
        string memory name_,
        string memory symbol_,
        uint8 decimals_,
        uint256 initialSupply_
    ) {
        _name = name_;
        _symbol = symbol_;
        _decimals = decimals_;
        // Set cap to 21,000,000 tokens considering decimals
        _cap = 21_000_000 * (10 ** uint256(decimals_));
        require(initialSupply_ <= _cap, "ERC20: initial supply exceeds cap");
        _mint(msg.sender, initialSupply_);
    }

    // ERC20 view functions
    function name() external view returns (string memory) { return _name; }
    function symbol() external view returns (string memory) { return _symbol; }
    function decimals() external view returns (uint8) { return _decimals; }
    function totalSupply() external view returns (uint256) { return _totalSupply; }
    function cap() external view returns (uint256) { return _cap; }
    function balanceOf(address account) external view returns (uint256) { return _balances[account]; }
    function allowance(address owner, address spender) external view returns (uint256) { return _allowances[owner][spender]; }

    // Core ERC20 logic
    function transfer(address to, uint256 amount) external returns (bool) {
        _transfer(msg.sender, to, amount);
        return true;
    }

    function approve(address spender, uint256 amount) external returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address from, address to, uint256 amount) external returns (bool) {
        uint256 currentAllowance = _allowances[from][msg.sender];
        require(currentAllowance >= amount, "ERC20: insufficient allowance");
        unchecked { _approve(from, msg.sender, currentAllowance - amount); }
        _transfer(from, to, amount);
        return true;
    }

    // Minting: anyone can mint up to 1000 tokens per call
    function mint(uint256 amount) external returns (bool) {
        require(amount > 0, "ERC20: mint zero");
        uint256 maxPerTx = 1000 * (10 ** uint256(_decimals));
        require(amount <= maxPerTx, "ERC20: exceeds 1000 per tx");
        _mint(msg.sender, amount);
        return true;
    }

    // Internal helpers
    function _transfer(address from, address to, uint256 amount) internal {
        require(from != address(0), "ERC20: transfer from zero");
        require(to != address(0), "ERC20: transfer to zero");

        uint256 fromBal = _balances[from];
        require(fromBal >= amount, "ERC20: transfer exceeds balance");
        unchecked {
            _balances[from] = fromBal - amount;
            _balances[to] += amount;
        }
        emit Transfer(from, to, amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal {
        require(owner != address(0), "ERC20: approve from zero");
        require(spender != address(0), "ERC20: approve to zero");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _mint(address to, uint256 amount) internal {
        require(to != address(0), "ERC20: mint to zero");
        // Enforce cap
        require(_totalSupply + amount <= _cap, "ERC20: cap exceeded");
        _totalSupply += amount;
        _balances[to] += amount;
        emit Transfer(address(0), to, amount);
    }
}

